INSERT INTO `sys_rule_action_param` VALUES ('RULACT304e882a:171c8fba402:-7346', 'RACT304e882a:171c8fba402:-7372', 'waterworks.actions.ComputeConsumption.amount', NULL, NULL, 'RCONST304e882a:171c8fba402:-73cf', 'VOL', '<table border=\"1\" cellpadding=\"1\" cellspacing=\"0\">\n    <tr>\n        <td colspan=\"3\">Use Variable: VOL</td>\n    </tr>\n    \n        <tr>\n            <th>Greater than</th>\n            <th>Less than or equal to</th>\n            <th>Formula</th>\n        </tr>\n    \n    \n    \n        <tr>\n            <td></td>\n            <td>10.00</td>\n            <td>62</td>\n        </tr>\n    \n        <tr>\n            <td>10.00</td>\n            <td>20.00</td>\n            <td>62+((VOL-10)*7)</td>\n        </tr>\n    \n        <tr>\n            <td>20.00</td>\n            <td>30.00</td>\n            <td>132+((VOL-20)*8)</td>\n        </tr>\n    \n        <tr>\n            <td>30.00</td>\n            <td>40.00</td>\n            <td>212+((VOL-30)*11)</td>\n        </tr>\n    \n        <tr>\n            <td>40.00</td>\n            <td>50.00</td>\n            <td>322+((VOL-40)*14)</td>\n        </tr>\n    \n        <tr>\n            <td>50.00</td>\n            <td>60.00</td>\n            <td>462+((VOL-50)*17)</td>\n        </tr>\n    \n        <tr>\n            <td>60.00</td>\n            <td>70.00</td>\n            <td>632+((VOL-60)*20)</td>\n        </tr>\n    \n        <tr>\n            <td>70.00</td>\n            <td>9999.00</td>\n            <td>832+((VOL-70)*23)</td>\n        </tr>\n    \n</table>', 'range', NULL, NULL, NULL, '[[value:\"62\",to:10.00,from:0.00],[value:\"62+((VOL-10)*7)\",to:20.00,from:10.00],[value:\"132+((VOL-20)*8)\",to:30.00,from:20.00],[value:\"212+((VOL-30)*11)\",to:40.00,from:30.00],[value:\"322+((VOL-40)*14)\",to:50.00,from:40.00],[value:\"462+((VOL-50)*17)\",to:60.00,from:50.00],[value:\"632+((VOL-60)*20)\",to:70.00,from:60.00],[value:\"832+((VOL-70)*23)\",to:9999.00,from:70.00]]', NULL, 1);
