INSERT INTO `sys_rule_deployed` VALUES ('RUL6467d37d:1728451ba8a:-6fc4', '\npackage waterworksbillingschedule.S07;\nimport waterworksbillingschedule.*;\nimport java.util.*;\nimport com.rameses.rules.common.*;\n\nglobal RuleAction action;\n\nrule \"S07\"\n	agenda-group \"initial\"\n	salience 50000\n	no-loop\n	when\n		\n		\n		WBS: waterworks.facts.WaterScheduleGroup (  id matches \"S07\" ) \n		\n		BILPRD: waterworks.facts.WaterBillingPeriod (  MON:month,YR:year ) \n		\n	then\n		Map bindings = new HashMap();\n		\n		bindings.put(\"WBS\", WBS );\n		\n		bindings.put(\"MON\", MON );\n		\n		bindings.put(\"BILPRD\", BILPRD );\n		\n		bindings.put(\"YR\", YR );\n		\n	Map _p0 = new HashMap();\n_p0.put( \"billingperiod\", BILPRD );\n_p0.put( \"fromdate\", (new ActionExpression(\"@MONTHADD(   @DATE( YR , MON , 25 ), -2 );\", bindings)) );\n_p0.put( \"todate\", (new ActionExpression(\"@MONTHADD( @DATE( YR , MON , 26 ), -1 )\", bindings)) );\n_p0.put( \"readingdate\", (new ActionExpression(\"@MONTHADD( @DATE( YR , MON , 27 ), -1 )\", bindings)) );\n_p0.put( \"billdate\", (new ActionExpression(\"@DATE( YR , MON,  1)\", bindings)) );\n_p0.put( \"duedate\", (new ActionExpression(\"@DATE( YR , MON,  7 );\", bindings)) );\n_p0.put( \"billexpirydate\", (new ActionExpression(\"@DATE( YR , MON,  24 );\", bindings)) );\naction.execute( \"set-waterworks-billing-period\",_p0,drools);\n\nend\n\n\n	');
INSERT INTO `sys_rule_deployed` VALUES ('RUL746193b0:1684af9777d:-760b', '\npackage waterworkspayment.APPLY_EXCESS_PAYMENT;\nimport waterworkspayment.*;\nimport java.util.*;\nimport com.rameses.rules.common.*;\n\nglobal RuleAction action;\n\nrule \"APPLY_EXCESS_PAYMENT\"\n	agenda-group \"payment\"\n	salience 50000\n	no-loop\n	when\n		\n		\n		EXPMT: treasury.facts.ExcessPayment (  AMT:amount > 0.00 ) \n		\n	then\n		Map bindings = new HashMap();\n		\n		bindings.put(\"EXPMT\", EXPMT );\n		\n		bindings.put(\"AMT\", AMT );\n		\n	Map _p0 = new HashMap();\n_p0.put( \"billcode\", new KeyValue(\"WATERFEE_ADV\", \"WATER FEE ADVANCE PAYMENT\") );\n_p0.put( \"amount\", (new ActionExpression(\"AMT\", bindings)) );\naction.execute( \"add-credit-billitem\",_p0,drools);\n\nend\n\n\n	');
INSERT INTO `sys_rule_deployed` VALUES ('RUL746193b0:1684af9777d:-77bd', '\npackage waterworkspayment.APPLY_PAYMENT;\nimport waterworkspayment.*;\nimport java.util.*;\nimport com.rameses.rules.common.*;\n\nglobal RuleAction action;\n\nrule \"APPLY_PAYMENT\"\n	agenda-group \"payment\"\n	salience 50000\n	no-loop\n	when\n		\n		\n		PMT: treasury.facts.Payment (  amount > 0.00 ) \n		\n	then\n		Map bindings = new HashMap();\n		\n		bindings.put(\"PMT\", PMT );\n		\n	Map _p0 = new HashMap();\n_p0.put( \"payment\", PMT );\naction.execute( \"apply-payment\",_p0,drools);\n\nend\n\n\n	');
INSERT INTO `sys_rule_deployed` VALUES ('RUL7b139fa4:171e2269d93:-7e90', '\npackage waterworksbilling.ADD_WATER_BILL_ITEM;\nimport waterworksbilling.*;\nimport java.util.*;\nimport com.rameses.rules.common.*;\n\nglobal RuleAction action;\n\nrule \"ADD_WATER_BILL_ITEM\"\n	agenda-group \"computefee\"\n	salience 50000\n	no-loop\n	when\n		\n		\n		WC: waterworks.facts.WaterConsumption (  AMT:amount > 0.00,hold == false  ) \n		\n		WB: waterworks.facts.WaterBill (  YR:year,MON:month ) \n		\n	then\n		Map bindings = new HashMap();\n		\n		bindings.put(\"WC\", WC );\n		\n		bindings.put(\"YR\", YR );\n		\n		bindings.put(\"AMT\", AMT );\n		\n		bindings.put(\"WB\", WB );\n		\n		bindings.put(\"MON\", MON );\n		\n	Map _p0 = new HashMap();\n_p0.put( \"year\", YR );\n_p0.put( \"month\", MON );\n_p0.put( \"amount\", (new ActionExpression(\"AMT\", bindings)) );\n_p0.put( \"billcode\", new KeyValue(\"WATER_FEE\", \"WATER FEE\") );\naction.execute( \"add-waterbillitem\",_p0,drools);\n\nend\n\n\n	');
