DROP VIEW IF EXISTS `vw_waterworks_disconnection`;
CREATE ALGORITHM=UNDEFINED DEFINER=`root`@`localhost` SQL SECURITY DEFINER VIEW `vw_waterworks_disconnection` AS select `wcr`.`objid` AS `objid`,`wcr`.`controlno` AS `controlno`,`wcr`.`dtcreated` AS `dtcreated`,`wcr`.`acctid` AS `acctid`,`wcr`.`acctinfoid` AS `acctinfoid`,`wcr`.`reason` AS `reason`,`wcr`.`taskid` AS `taskid`,`wcr`.`amountdue` AS `amountdue`,`wa`.`acctno` AS `account_acctno`,`t`.`state` AS `task_state`,`t`.`startdate` AS `task_startdate`,`t`.`enddate` AS `task_enddate`,`t`.`assignee_objid` AS `task_assignee_objid`,`t`.`assignee_name` AS `task_assignee_name`,`t`.`actor_objid` AS `task_actor_objid`,`t`.`actor_name` AS `task_actor_name`,(select `sys_wf_node`.`title` from `sys_wf_node` where ((`sys_wf_node`.`processname` = 'waterworks_disconnection') and (`sys_wf_node`.`name` = `t`.`state`))) AS `task_title` from ((`waterworks_disconnection` `wcr` join `waterworks_disconnection_task` `t` on((`wcr`.`taskid` = `t`.`taskid`))) join `waterworks_account` `wa` on((`wcr`.`acctid` = `wa`.`objid`)));

